<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Outfit Downloads - Infamous</title>
  <link rel="icon" href="images/logo.png" type="image/x-icon">
  <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.4.0/css/all.min.css">
  <link href="https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600;700;800&family=Poppins:wght@300;400;500;600;700;800&display=swap" rel="stylesheet">
  <style>
    :root {
      --primary-color: #dc2626;
      --secondary-color: #ef4444;
      --accent-color: #fbbf24;
      --text-primary: #ffffff;
      --text-secondary: #cbd5e1;
      --text-muted: #64748b;
      --background: #0a0a0a;
      --surface: rgba(255, 255, 255, 0.03);
      --surface-hover: rgba(255, 255, 255, 0.05);
      --border-color: rgba(255, 255, 255, 0.08);
      --border-hover: rgba(220, 38, 38, 0.3);
      --gradient-primary: linear-gradient(135deg, #dc2626, #ef4444);
      --shadow-lg: 0 10px 30px rgba(0, 0, 0, 0.4);
      --shadow-glow: 0 0 30px rgba(220, 38, 38, 0.15);
      --transition-fast: all 0.2s ease;
      --transition-normal: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
      --blur-sm: blur(10px);
      --blur-md: blur(20px);
      --blur-lg: blur(40px);
    }

    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }

    body {
      font-family: 'Inter', -apple-system, BlinkMacSystemFont, 'Segoe UI', sans-serif;
      background: var(--background);
      color: var(--text-primary);
      line-height: 1.6;
      min-height: 100vh;
      overflow-x: hidden;
    }

    .container {
      max-width: 1200px;
      margin: 0 auto;
      padding: 2rem;
    }

    /* Hero Section */
    .downloads-hero {
      min-height: 40vh;
      display: flex;
      align-items: center;
      position: relative;
      overflow: hidden;
      padding: 100px 0 60px;
      background-color: rgba(0, 0, 0, 0.192);
      backdrop-filter: var(--blur-md);
      border-radius: 0 0 20px 20px;
      margin-bottom: 2rem;
      z-index: 0;
    }

    .downloads-hero::before {
      content: '';
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;   
      background: 
        radial-gradient(circle at 80% 20%, rgba(239, 68, 68, 0.02) 0%, transparent 50%);
      z-index: 1;
    }

    .downloads-hero-content {
      text-align: center;
      z-index: 2;
      position: relative;
      max-width: 600px;
      margin: 0 auto;
    }

    .downloads-hero-badge {
      display: inline-flex;
      align-items: center;
      gap: 8px;
      background: rgba(220, 38, 38, 0.1);
      border: 1px solid rgba(220, 38, 38, 0.2);
      border-radius: 50px;
      padding: 8px 20px;
      margin-bottom: 2rem;
      font-size: 0.9rem;
      font-weight: 500;
      color: var(--primary-color);
      backdrop-filter: var(--blur-sm);
    }

    .downloads-hero-badge i {
      font-size: 0.8rem;
    }

    .downloads-hero h1 {
      font-size: 2.8rem;
      font-weight: 800;
      background: var(--gradient-primary);
      background-clip: text;
      -webkit-background-clip: text;
      -webkit-text-fill-color: transparent;
      margin-bottom: 1.5rem;
      font-family: 'Inter', sans-serif;
      letter-spacing: -0.02em;
      line-height: 1.1;
    }

    .downloads-hero p {
      font-size: 1.1rem;
      color: var(--text-secondary);
      margin: 0 auto 2.5rem;
      line-height: 1.6;
      max-width: 500px;
    }

    /* Search Section */
    .search-section {
      margin: 3rem 0;
      max-width: 600px;
      margin-left: auto;
      margin-right: auto;
    }

    .search-container {
      position: relative;
      background: var(--surface);
      backdrop-filter: var(--blur-md);
      border: 1px solid var(--border-color);
      border-radius: 16px;
      transition: var(--transition-normal);
      overflow: hidden;
    }

    .search-container::before {
      content: '';
      position: absolute;
      top: 0;
      left: -100%;
      width: 100%;
      height: 100%;
      background: linear-gradient(90deg, transparent, rgba(220, 38, 38, 0.15), transparent);
      transition: left 0.6s ease;
      z-index: 0;
    }

    .search-container:hover::before {
      left: 100%;
    }

    .search-container:hover {
      border-color: var(--border-hover);
      box-shadow: var(--shadow-glow);
    }

    .search-input-wrapper {
      display: flex;
      align-items: center;
      gap: 1rem;
      padding: 1rem 1.5rem;
      position: relative;
      z-index: 1;
    }

    .search-icon {
      color: var(--primary-color);
      font-size: 1.1rem;
      flex-shrink: 0;
    }

    .search-input {
      flex: 1;
      background: transparent;
      border: none;
      color: var(--text-primary);
      font-size: 1rem;
      font-family: inherit;
      outline: none;
    }

    .search-input::placeholder {
      color: var(--text-muted);
    }

    .clear-search {
      background: none;
      border: none;
      color: var(--text-muted);
      cursor: pointer;
      padding: 0.5rem;
      border-radius: 8px;
      transition: var(--transition-fast);
      opacity: 0;
      pointer-events: none;
      flex-shrink: 0;
    }

    .clear-search.visible {
      opacity: 1;
      pointer-events: auto;
    }

    .clear-search:hover {
      color: var(--primary-color);
      background: rgba(220, 38, 38, 0.1);
    }

    /* Stats Cards */
    .stats-section {
      margin: 3rem 0;
    }

    .stats-grid {
      display: grid;
      grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
      gap: 1.5rem;
      max-width: 800px;
      margin: 0 auto;
    }

    .stat-card {
      background: var(--surface);
      backdrop-filter: var(--blur-md);
      border: 1px solid var(--border-color);
      border-radius: 16px;
      padding: 2rem;
      text-align: center;
      transition: var(--transition-normal);
      position: relative;
      overflow: hidden;
    }

    .stat-card::before {
      content: '';
      position: absolute;
      top: 0;
      left: -100%;
      width: 100%;
      height: 100%;
      background: linear-gradient(90deg, transparent, rgba(220, 38, 38, 0.15), transparent);
      transition: left 0.6s ease;
      z-index: 0;
    }

    .stat-card:hover::before {
      left: 100%;
    }

    .stat-card:hover {
      transform: translateY(-8px);
      border-color: var(--border-hover);
      box-shadow: var(--shadow-glow);
    }

    .stat-icon {
      width: 48px;
      height: 48px;
      background: var(--gradient-primary);
      border-radius: 12px;
      display: flex;
      align-items: center;
      justify-content: center;
      font-size: 20px;
      color: white;
      margin: 0 auto 1rem;
      box-shadow: 0 8px 20px rgba(220, 38, 38, 0.3);
      transition: transform 0.3s ease;
      position: relative;
      z-index: 1;
    }

    .stat-card:hover .stat-icon {
      transform: rotate(10deg) scale(1.1);
    }

    .stat-number {
      display: block;
      font-size: 1.8rem;
      font-weight: 700;
      color: var(--primary-color);
      margin-bottom: 0.5rem;
      position: relative;
      z-index: 1;
    }

    .stat-label {
      font-size: 0.9rem;
      color: var(--text-secondary);
      font-weight: 500;
      position: relative;
      z-index: 1;
    }

    /* Outfits Grid */
    .outfits-section {
      margin: 4rem 0;
    }

    .outfits-grid {
      display: grid;
      grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
      gap: 1.5rem;
      animation: fadeIn 0.6s ease-out;
    }

    @keyframes fadeIn {
      from { opacity: 0; transform: translateY(20px); }
      to { opacity: 1; transform: translateY(0); }
    }

    /* Outfit Cards */
    .outfit-card {
      background: var(--surface);
      backdrop-filter: var(--blur-md);
      border: 1px solid var(--border-color);
      border-radius: 20px;
      overflow: hidden;
      transition: var(--transition-normal);
      position: relative;
      opacity: 0;
      transform: translateY(30px);
      animation: slideUp 0.6s ease-out forwards;
    }

    .outfit-card:nth-child(n) { animation-delay: calc(var(--index, 0) * 0.1s); }

    @keyframes slideUp {
      from { opacity: 0; transform: translateY(30px); }
      to { opacity: 1; transform: translateY(0); }
    }

    @keyframes rotate {
      100% { transform: rotate(360deg); }
    }

    .outfit-card:hover {
      transform: translateY(-12px) scale(1.02);
      border-color: var(--border-hover);
      box-shadow: 
        var(--shadow-glow),
        0 25px 50px rgba(220, 38, 38, 0.15);
    }

    .outfit-images {
      display: grid;
      grid-template-columns: repeat(auto-fit, minmax(140px, 1fr));
      gap: 0.75rem;
      padding: 1.5rem;
      background: rgba(0, 0, 0, 0.2);
      position: relative;
      overflow: hidden;
    }

    .outfit-images::before {
      content: '';
      position: absolute;
      top: 0;
      left: 0;
      right: 0;
      bottom: 0;
      background: linear-gradient(45deg, 
        rgba(220, 38, 38, 0.05) 0%, 
        transparent 25%, 
        transparent 75%, 
        rgba(220, 38, 38, 0.05) 100%);
      pointer-events: none;
      z-index: 0;
    }

    .outfit-images > * {
      position: relative;
      z-index: 1;
    }

    .outfit-images img {
      width: 100%;
      height: 140px;
      object-fit: cover;
      border-radius: 12px;
      transition: var(--transition-normal);
      cursor: pointer;
      border: 2px solid transparent;
      box-shadow: 0 4px 15px rgba(0, 0, 0, 0.2);
    }

    .outfit-images img:hover {
      transform: scale(1.08) rotate(1deg);
      border-color: var(--primary-color);
      box-shadow: 
        0 8px 25px rgba(220, 38, 38, 0.3),
        0 0 20px rgba(220, 38, 38, 0.2);
      z-index: 10;
    }

    /* Image Badge */
    .image-badge {
      position: absolute;
      top: 8px;
      right: 8px;
      background: var(--gradient-primary);
      color: white;
      font-size: 0.7rem;
      padding: 4px 8px;
      border-radius: 12px;
      font-weight: 600;
      z-index: 2;
      box-shadow: 0 2px 8px rgba(220, 38, 38, 0.4);
    }

    .outfit-info {
      padding: 1.5rem;
      display: flex;
      flex-direction: column;
      gap: 1rem;
    }

    .outfit-name {
      font-size: 1.1rem;
      font-weight: 600;
      color: var(--text-primary);
      text-align: center;
      letter-spacing: -0.02em;
    }

    .download-btn {
      display: inline-flex;
      align-items: center;
      justify-content: center;
      gap: 0.5rem;
      padding: 0.875rem 1.5rem;
      background: var(--gradient-primary);
      color: white;
      text-decoration: none;
      border-radius: 12px;
      font-weight: 500;
      font-size: 0.875rem;
      transition: var(--transition-normal);
      position: relative;
      overflow: hidden;
      box-shadow: 0 8px 20px rgba(220, 38, 38, 0.3);
    }

    .download-btn:hover {
      transform: translateY(-2px);
      box-shadow: 0 12px 30px rgba(220, 38, 38, 0.4);
    }

    .download-icon {
      transition: var(--transition-fast);
    }

    .download-btn:hover .download-icon {
      transform: translateY(2px);
    }

    /* No Results */
    .no-results {
      text-align: center;
      padding: 4rem 2rem;
      background: var(--surface);
      backdrop-filter: var(--blur-md);
      border: 1px solid var(--border-color);
      border-radius: 20px;
      margin: 2rem 0;
    }

    .no-results-icon {
      font-size: 3rem;
      margin-bottom: 1rem;
      color: var(--text-muted);
      opacity: 0.5;
    }

    .no-results-title {
      font-size: 1.5rem;
      font-weight: 600;
      margin-bottom: 0.5rem;
      color: var(--text-secondary);
    }

    .no-results-text {
      font-size: 1rem;
      color: var(--text-muted);
      max-width: 400px;
      margin: 0 auto;
    }

    /* Utilities */
    .hidden {
      display: none !important;
    }

    /* Image Modal */
    .image-modal {
      display: none;
      position: fixed;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      background: rgba(0, 0, 0, 0.95);
      z-index: 2000;
      align-items: center;
      justify-content: center;
      backdrop-filter: var(--blur-lg);
    }

    .image-modal.active {
      display: flex;
    }

    .modal-content {
      max-width: 90%;
      max-height: 90%;
      border-radius: 16px;
      box-shadow: var(--shadow-lg);
      border: 1px solid var(--border-color);
      transition: var(--transition-normal);
      animation: modalZoomIn 0.3s ease-out;
    }

    @keyframes modalZoomIn {
      from {
        opacity: 0;
        transform: scale(0.8);
      }
      to {
        opacity: 1;
        transform: scale(1);
      }
    }

    .close-modal {
      position: absolute;
      top: 20px;
      right: 20px;
      color: white;
      font-size: 2rem;
      cursor: pointer;
      z-index: 2001;
      background: rgba(0, 0, 0, 0.8);
      border-radius: 50%;
      width: 50px;
      height: 50px;
      display: flex;
      align-items: center;
      justify-content: center;
      transition: var(--transition-normal);
      backdrop-filter: var(--blur-sm);
      border: 1px solid var(--border-color);
    }

    .close-modal:hover {
      background: rgba(220, 38, 38, 0.8);
      transform: scale(1.1);
      border-color: var(--primary-color);
    }

    /* Loading Animations */
    @keyframes shimmer {
      0% { background-position: -200px 0; }
      100% { background-position: calc(200px + 100%) 0; }
    }

    .loading-shimmer {
      background: linear-gradient(90deg, 
        transparent, 
        rgba(220, 38, 38, 0.2), 
        transparent);
      background-size: 200px 100%;
      animation: shimmer 1.5s infinite;
    }

    /* Tooltip Styles */
    .tooltip {
      position: relative;
    }

    .tooltip::after {
      content: attr(data-tooltip);
      position: absolute;
      bottom: 120%;
      left: 50%;
      transform: translateX(-50%);
      background: rgba(0, 0, 0, 0.9);
      color: white;
      padding: 8px 12px;
      border-radius: 8px;
      font-size: 0.8rem;
      white-space: nowrap;
      opacity: 0;
      visibility: hidden;
      transition: var(--transition-normal);
      z-index: 1000;
      backdrop-filter: blur(10px);
    }

    .tooltip:hover::after {
      opacity: 1;
      visibility: visible;
    }

    /* Premium Glow Effects */
    .premium-glow {
      position: relative;
    }

    .premium-glow::before {
      content: '';
      position: absolute;
      top: -2px;
      left: -2px;
      right: -2px;
      bottom: -2px;
      background:rgba(10, 10, 10, 255);
      border-radius: inherit;
      opacity: 0;
      transition: var(--transition-normal);
      animation: rotate 8s linear infinite paused;
      z-index: -1;
    }

    .premium-glow:hover::before {
      opacity: 0.8;
      animation-play-state: running;
    }

    /* Floating particles effect */
    .particles {
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      overflow: hidden;
      pointer-events: none;
    }

    .particle {
      position: absolute;
      background: var(--primary-color);
      border-radius: 50%;
      opacity: 0.6;
      animation: float 6s ease-in-out infinite;
    }

    @keyframes float {
      0%, 100% { transform: translateY(0) rotate(0deg); opacity: 0; }
      50% { opacity: 0.6; }
      100% { transform: translateY(-100vh) rotate(360deg); opacity: 0; }
    }

    /* Enhanced outfit card effects */
    .outfit-card:hover .outfit-title {
      background: var(--gradient-primary);
      -webkit-background-clip: text;
      -webkit-text-fill-color: transparent;
      background-clip: text;
    }

    .outfit-card .outfit-description {
      transition: var(--transition-normal);
    }

    .outfit-card:hover .outfit-description {
      color: var(--primary-color);
    }

    /* Staggered animations for cards */
    .outfit-card:nth-child(1) { animation-delay: 0.1s; }
    .outfit-card:nth-child(2) { animation-delay: 0.2s; }
    .outfit-card:nth-child(3) { animation-delay: 0.3s; }
    .outfit-card:nth-child(4) { animation-delay: 0.4s; }
    .outfit-card:nth-child(5) { animation-delay: 0.5s; }
    .outfit-card:nth-child(6) { animation-delay: 0.6s; }

    /* Responsive Design */
    @media (max-width: 768px) {
      .container {
        padding: 1rem;
      }

      .downloads-hero {
        min-height: 35vh;
        padding: 80px 0 50px;
      }

      .downloads-hero h1 {
        font-size: 2.2rem;
      }

      .downloads-hero p {
        font-size: 1rem;
        margin-bottom: 2rem;
      }

      .outfits-grid {
        grid-template-columns: 1fr;
        gap: 1.5rem;
      }

      .outfit-images {
        grid-template-columns: repeat(auto-fit, minmax(120px, 1fr));
        padding: 1rem;
      }

      .outfit-images img {
        height: 100px;
      }

      .stats-grid {
        grid-template-columns: repeat(3, 1fr);
        gap: 1rem;
      }

      .stat-card {
        padding: 1.5rem;
      }

      .stat-number {
        font-size: 1.5rem;
      }
    }

    @media (max-width: 480px) {
      .downloads-hero {
        padding: 70px 0 40px;
        min-height: 30vh;
      }

      .downloads-hero h1 {
        font-size: 1.9rem;
      }

      .outfit-images {
        grid-template-columns: 1fr 1fr;
      }

      .search-input-wrapper {
        padding: 0.875rem 1.25rem;
      }

      .stats-grid {
        grid-template-columns: 1fr;
        gap: 1rem;
      }
    }
  </style>
</head>

    <!-- Outfits Section -->
    <section class="outfits-section">

      <div id="noResults" class="no-results hidden">

    </section>
  </div>

    <span class="close-modal" onclick="closeImageModal()">&times;</span>
    <img class="modal-content" id="modalImage">
  </div>

    // DOM elements
    const outfitsContainer = document.getElementById('outfits');
    const searchInput = document.getElementById('searchInput');
    const clearSearchBtn = document.getElementById('clearSearch');
    const noResultsDiv = document.getElementById('noResults');
    const totalCountSpan = document.getElementById('totalCount');

    // State
    let allOutfits = [];
    let filteredOutfits = [];

    // Utility functions
    function getOutfitName(url) {
      try {
        const match = url.match(/\/([^\/?#]+)\.(json|zip|rar)/i);
        if (match) return match[1];
      } catch {}
      return "Download";
    }

    function formatOutfitName(name) {
      return name
        .replace(/([A-Z])/g, ' $1')
        .replace(/^./, str => str.toUpperCase())
        .trim();
    }

    function debounce(func, wait) {
      let timeout;
      return function executedFunction(...args) {
        const later = () => {
          clearTimeout(timeout);
          func(...args);
        };
        clearTimeout(timeout);
        timeout = setTimeout(later, wait);
      };
    }

    // Search functionality
    function filterOutfits(searchTerm) {
      if (!searchTerm.trim()) {
        filteredOutfits = [...allOutfits];
      } else {
        const term = searchTerm.toLowerCase();
        filteredOutfits = allOutfits.filter(outfit => {
          const name = formatOutfitName(getOutfitName(outfit.download)).toLowerCase();
          return name.includes(term);
        });
      }
      renderOutfits();
    }

    const debouncedFilter = debounce(filterOutfits, 300);

    // Image modal functionality
    function openImageModal(src) {
      const modal = document.getElementById('imageModal');
      const modalImg = document.getElementById('modalImage');
      modal.classList.add('active');
      modalImg.src = src;
      document.body.style.overflow = 'hidden';
    }

    function closeImageModal() {
      const modal = document.getElementById('imageModal');
      modal.classList.remove('active');
      document.body.style.overflow = 'auto';
    }

    // Close modal with ESC key
    document.addEventListener('keydown', function(e) {
      if (e.key === 'Escape') {
        closeImageModal();
      }
    });

    // Create outfit card
    function createOutfitCard(outfit, index) {
      const card = document.createElement('div');
      card.className = 'outfit-card premium-glow tooltip';
      card.style.setProperty('--index', index);
      card.setAttribute('data-tooltip', `Click to explore ${formatOutfitName(getOutfitName(outfit.download))}`);

      // Images section
      const imagesDiv = document.createElement('div');
      imagesDiv.className = 'outfit-images';
      
      if (outfit.attachments && outfit.attachments.length) {
        outfit.attachments.forEach((imgUrl, imgIndex) => {
          if (/\.(png|jpg|jpeg|webp)$/i.test(imgUrl.split('?')[0])) {
            const imgContainer = document.createElement('div');
            imgContainer.style.position = 'relative';
            
            const img = document.createElement('img');
            img.src = imgUrl;
            img.alt = `${getOutfitName(outfit.download)} preview`;
            img.loading = 'lazy';
            
            // Add image badge for multiple images
            if (outfit.attachments.length > 1) {
              const badge = document.createElement('div');
              badge.className = 'image-badge';
              badge.textContent = `${imgIndex + 1}/${outfit.attachments.length}`;
              imgContainer.appendChild(badge);
            }
            
            img.addEventListener('click', () => {
              openImageModal(imgUrl);
              createClickParticles(img);
            });
            
            imgContainer.appendChild(img);
            imagesDiv.appendChild(imgContainer);
          }
        });
      }
      
      // If no images, add placeholder
      if (imagesDiv.children.length === 0) {
        const placeholder = document.createElement('div');
        placeholder.style.cssText = `
          width: 100%;
          height: 140px;
          background: var(--surface-hover);
          border-radius: 12px;
          display: flex;
          align-items: center;
          justify-content: center;
          color: var(--text-muted);
          font-size: 1.5rem;
        `;
        placeholder.innerHTML = '<i class="fas fa-image"></i>';
        imagesDiv.appendChild(placeholder);
      }
      
      card.appendChild(imagesDiv);

      // Info section
      const infoDiv = document.createElement('div');
      infoDiv.className = 'outfit-info';

      // Outfit name
      const nameDiv = document.createElement('div');
      nameDiv.className = 'outfit-name outfit-title';
      nameDiv.textContent = formatOutfitName(getOutfitName(outfit.download));
      infoDiv.appendChild(nameDiv);

      // Outfit description
      const descDiv = document.createElement('div');
      descDiv.className = 'outfit-description';
      descDiv.textContent = `Premium outfit collection  ${outfit.attachments?.length || 0} images`;
      infoDiv.appendChild(descDiv);

      // Download button
      const downloadBtn = document.createElement('a');
      downloadBtn.className = 'download-btn';
      downloadBtn.href = outfit.download;
      downloadBtn.download = '';
      downloadBtn.innerHTML = `
        <i class="fas fa-download download-icon"></i>
        Download ${formatOutfitName(getOutfitName(outfit.download))}
      `;
      
      downloadBtn.addEventListener('click', () => {
        createDownloadParticles(downloadBtn);
      });
      
      infoDiv.appendChild(downloadBtn);

      card.appendChild(infoDiv);
      return card;
    }

    // Create click particles effect
    function createClickParticles(element) {
      const rect = element.getBoundingClientRect();
      const centerX = rect.left + rect.width / 2;
      const centerY = rect.top + rect.height / 2;
      
      for (let i = 0; i < 8; i++) {
        const particle = document.createElement('div');
        particle.style.cssText = `
          position: fixed;
          width: 4px;
          height: 4px;
          background: var(--primary-color);
          border-radius: 50%;
          pointer-events: none;
          z-index: 1000;
          left: ${centerX}px;
          top: ${centerY}px;
        `;
        
        document.body.appendChild(particle);
        
        const angle = (i / 8) * Math.PI * 2;
        const distance = 50 + Math.random() * 30;
        const endX = centerX + Math.cos(angle) * distance;
        const endY = centerY + Math.sin(angle) * distance;
        
        particle.animate([
          { transform: 'translate(0, 0) scale(1)', opacity: 1 },
          { transform: `translate(${endX - centerX}px, ${endY - centerY}px) scale(0)`, opacity: 0 }
        ], {
          duration: 600,
          easing: 'cubic-bezier(0.25, 0.46, 0.45, 0.94)'
        }).onfinish = () => particle.remove();
      }
    }

    // Create download particles effect
    function createDownloadParticles(element) {
      const rect = element.getBoundingClientRect();
      const centerX = rect.left + rect.width / 2;
      const centerY = rect.top + rect.height / 2;
      
      for (let i = 0; i < 12; i++) {
        const particle = document.createElement('div');
        particle.style.cssText = `
          position: fixed;
          width: 6px;
          height: 6px;
          background: linear-gradient(45deg, var(--primary-color), #fbbf24);
          border-radius: 50%;
          pointer-events: none;
          z-index: 1000;
          left: ${centerX}px;
          top: ${centerY}px;
        `;
        
        document.body.appendChild(particle);
        
        const angle = (i / 12) * Math.PI * 2;
        const distance = 80 + Math.random() * 40;
        const endX = centerX + Math.cos(angle) * distance;
        const endY = centerY + Math.sin(angle) * distance;
        
        particle.animate([
          { transform: 'translate(0, 0) scale(1) rotate(0deg)', opacity: 1 },
          { transform: `translate(${endX - centerX}px, ${endY - centerY}px) scale(0) rotate(360deg)`, opacity: 0 }
        ], {
          duration: 800,
          easing: 'cubic-bezier(0.25, 0.46, 0.45, 0.94)',
          delay: i * 50
        }).onfinish = () => particle.remove();
      }
    }

    // Create floating background particles
    function createFloatingParticles() {
      const container = document.querySelector('.container');
      const particlesContainer = document.createElement('div');
      particlesContainer.className = 'particles';
      container.appendChild(particlesContainer);

      function addParticle() {
        const particle = document.createElement('div');
        particle.className = 'particle';
        
        const size = Math.random() * 4 + 2;
        const startX = Math.random() * window.innerWidth;
        const duration = Math.random() * 4000 + 6000;
        
        particle.style.cssText = `
          width: ${size}px;
          height: ${size}px;
          left: ${startX}px;
          bottom: -10px;
          animation-duration: ${duration}ms;
          animation-delay: ${Math.random() * 2000}ms;
        `;
        
        particlesContainer.appendChild(particle);
        
        setTimeout(() => {
          if (particle.parentNode) {
            particle.remove();
          }
        }, duration + 2000);
      }

      // Create particles periodically (increased frequency)
      setInterval(addParticle, 200);
      
      // Create initial particles (more particles)
      for (let i = 0; i < 8; i++) {
        setTimeout(addParticle, i * 400);
      }
    }

    // Enhanced search with loading states
    function filterOutfits(searchTerm) {
      searchInput.classList.add('loading-shimmer');
      
      setTimeout(() => {
        if (searchTerm.trim() === '') {
          filteredOutfits = [...allOutfits];
        } else {
          const term = searchTerm.toLowerCase();
          filteredOutfits = allOutfits.filter(outfit => {
            const name = getOutfitName(outfit.download);
            return name.toLowerCase().includes(term);
          });
        }
        
        renderOutfits();
        searchInput.classList.remove('loading-shimmer');
      }, 150);
    }

    // Render outfits
    function renderOutfits() {
      outfitsContainer.innerHTML = '';
      
      if (filteredOutfits.length === 0) {
        outfitsContainer.classList.add('hidden');
        noResultsDiv.classList.remove('hidden');
        return;
      }

      outfitsContainer.classList.remove('hidden');
      noResultsDiv.classList.add('hidden');

      filteredOutfits.forEach((outfit, index) => {
        if (!outfit.download) return;
        const card = createOutfitCard(outfit, index);
        outfitsContainer.appendChild(card);
      });
    }

    // Initialize
    function init() {
      if (!data.messages || data.messages.length === 0) {
        allOutfits = [];
        filteredOutfits = [];
        noResultsDiv.querySelector('.no-results-title').textContent = 'No outfits available';
        noResultsDiv.querySelector('.no-results-text').textContent = 'Check back later for new outfit collections';
        noResultsDiv.classList.remove('hidden');
        return;
      }

      allOutfits = data.messages.filter(outfit => outfit.download);
      filteredOutfits = [...allOutfits];
      
      // Update total count
      totalCountSpan.textContent = allOutfits.length;
      
      renderOutfits();
      
      // Initialize floating particles
      setTimeout(createFloatingParticles, 1000);
      
      // Add loading animations to cards
      setTimeout(() => {
        document.querySelectorAll('.outfit-card').forEach((card, index) => {
          card.style.animation = `slideUp 0.6s cubic-bezier(0.25, 0.46, 0.45, 0.94) ${index * 0.1}s both`;
        });
      }, 100);
    }

    // Event listeners
    searchInput.addEventListener('input', (e) => {
      const value = e.target.value;
      debouncedFilter(value);
      
      // Show/hide clear button
      if (value.trim()) {
        clearSearchBtn.classList.add('visible');
      } else {
        clearSearchBtn.classList.remove('visible');
      }
    });

    clearSearchBtn.addEventListener('click', () => {
      searchInput.value = '';
      clearSearchBtn.classList.remove('visible');
      filterOutfits('');
      searchInput.focus();
    });

    // Keyboard shortcuts
    document.addEventListener('keydown', (e) => {
      if (e.ctrlKey && e.key === 'k') {
        e.preventDefault();
        searchInput.focus();
      }
      
      if (e.key === 'Escape' && document.activeElement === searchInput) {
        searchInput.blur();
      }
    });

    // Initialize when DOM is loaded
    if (document.readyState === 'loading') {
      document.addEventListener('DOMContentLoaded', init);
    } else {
      init();
    }

    // Intersection Observer for scroll animations
    const observerOptions = {
      threshold: 0.2,
      rootMargin: '0px 0px -50px 0px'
    };

    const observer = new IntersectionObserver((entries) => {
      entries.forEach(entry => {
        if (entry.isIntersecting) {
          entry.target.style.animation = 'slideUp 0.8s cubic-bezier(0.25, 0.46, 0.45, 0.94) both';
          observer.unobserve(entry.target);
        }
      });
    }, observerOptions);

    // Observe elements for scroll animations
    setTimeout(() => {
      document.querySelectorAll('.stat-card, .downloads-hero-content').forEach(el => {
        observer.observe(el);
      });
    }, 500);

    // Add parallax effect to hero section
    window.addEventListener('scroll', () => {
      const scrolled = window.pageYOffset;
      const hero = document.querySelector('.downloads-hero');
      if (hero) {
        hero.style.transform = `translateY(${scrolled * 0.3}px)`;
      }
    });

    // Performance optimization: Throttle scroll events
    let ticking = false;
    function updateParallax() {
      const scrolled = window.pageYOffset;
      const hero = document.querySelector('.downloads-hero');
      if (hero) {
        hero.style.transform = `translateY(${scrolled * 0.3}px)`;
      }
      ticking = false;
    }

    window.addEventListener('scroll', () => {
      if (!ticking) {
        requestAnimationFrame(updateParallax);
        ticking = true;
      }
    });
  </script>
</body>
</html>
